import React from "react";
import ReactDOM from "react-dom";
import App from "./App";

const root = document.getElementById("root");

if (root) {
  const app = (
    <React.StrictMode>
      <App />
    </React.StrictMode>
  );

  const rootComponent = ReactDOM.createRoot(root);
  rootComponent.render(app);
}
